import React from 'react';
import StickyNote from '../StickyNote';

const PendingTasks = () => {

    const loadTasks = () => {
       let data = JSON.stringify(localStorage.getItem(2));
       return(
           <StickyNote color={data.color}>{data.task}</StickyNote>
       )
    }


    return (
        <div>
            {
                loadTasks()
            }
        </div>
     );
}

export default PendingTasks;
